var ll=function(document,window,soffset,imgs){var imgs,i,j;var imgsData=[];var innerHeight=window.innerHeight;console.log("Running script");if(imgs){for(i=0;i<imgs.length;i++){var pos=imgs[i].getBoundingClientRect();pos.top<innerHeight?imgs[i].src=imgs[i].getAttribute("data-lsrc"):imgsData.push({i:i,y:pos.top,loaded:false,dsrc:imgs[i].getAttribute("data-lsrc")})}}function checkElements(elems){var offset=soffset||0;for(j=0;j<elems.length;j++){if(!elems[j].loaded&&elems[j].y<innerHeight+document.body.scrollTop+offset){imgs[elems[j].i].src=elems[j].dsrc;elems[j].loaded=true;console.log("Img "+elems[j].i+" loaded.")}}}document.onscroll=function(){checkElements(imgsData)};checkElements(imgsData);return{count:imgsData.length}};
